function addItems(e,t){for(var n=[],i=0;i<e.length;i++)if("undefined"!=typeof e[i].title){var d;d="undefined"!=typeof e[i].items?{text:e[i].title,menu:addItems(e[i].items,t)}:{text:e[i].title,onclick:onClickHandler(e[i],t)},n.push(d)}return n}function onClickHandler(e,t){return function(){"undefined"!=typeof e.value&&t.insertContent(e.value),"function"==typeof e.onSelect&&e.onSelect(e)}}tinymce.PluginManager.add("dsSnippets",function(e){var t=e.settings.ds_snippetslist;if("undefined"==typeof t)throw"No snippet data provided";e.addButton("dsSnippets",{type:"menubutton",tooltip:"DS snippets",image:"images/editor/snippet.gif",menu:addItems(t,e)})});
